INSERT INTO `t_news` (`n_id`, `nc_id`, `n_title`, `n_des`, `n_cover`, `n_content`, `n_sort`, `n_status`, `n_addtime`, `n_recommend`) VALUES
(4, 30, '如何推广', '如何推广', '', '<p><span style="color:#ff0000;font-size:18px">好资讯，好产品，好服务值得被传播</span><br/>长按下方二维码关注（搜索公众号：vispservice）</p><p><br/></p><p><img src="http://image.visp.info/news/20160819/d5a970cd-878d-4d9e-ad84-9bffce9a530f.jpg" _src="http://image.visp.info/news/20160819/d5a970cd-878d-4d9e-ad84-9bffce9a530f.jpg" height="365" width="368"/></p><p>朋友圈/好友推广<br/><br/>分享—＞将商城或者资讯一键分享给指定朋友或朋友圈，<br/>&nbsp; &nbsp; &nbsp; 好友通过您的分享，赠人玫瑰，手有余香。<br/><br/><span style="color:#ff0000;font-size:18px">&nbsp;好资讯、好产品、好服务 犹如蒲公英···</span></p><p><span style="color:#ff0000;font-size:18px"><br/></span></p><p><span style="color:#ff0000;font-size:18px"><span style="color: rgb(255, 0, 0);"><span style="color: rgb(255, 0, 0);"><span style="color: rgb(0, 0, 0);"><img src="http://image.visp.info/news/20160819/fb197f47-151a-4f9e-9bee-66c1ea146486.jpg" _src="http://image.visp.info/news/20160819/fb197f47-151a-4f9e-9bee-66c1ea146486.jpg" height="448" width="719"/></span></span></span><br/></span></p><p><span style="color:#ff0000;font-size:18px"><br/></span></p><p><span style="color:#ff0000;font-size:18px">我们的服务就是为您想的更多，为您做的更好！</span></p><p><span style="color:#ff0000;font-size:18px">服务热线：&nbsp; 400-8910-233<br/><br/></span></p><p><span style="color:#ff0000;font-size:18px"><br/></span></p><p><span style="color:#ff0000;font-size:18px"><br/></span></p><p><br/></p><p><br/></p>', 1, 1, '2016-08-19 09:24:09', 1),
(5, 29, '【饮水篇】奇迹之水的秘密', '探寻奇迹之水', 'http://image.visp.info/news/20160819/99ee0da5-354f-4db7-8bd8-ceec8c70b756.jpg', '<p><strong><img src="http://image.visp.info/news/20160819/3f6ce81c-91a0-4a72-bcd7-4e6b93d7bebb.jpg" _src="http://image.visp.info/news/20160819/3f6ce81c-91a0-4a72-bcd7-4e6b93d7bebb.jpg"/></strong></p><p><strong>1、法国卢尔德——奇迹之水</strong></p><p>&nbsp; &nbsp;法国南部的卢尔德地区有一个从未枯竭的水泉，每年都吸引着世界各国不同民族肤色，数以千万计的病患者到那里去朝圣，共同参拜西方人心目中的观音菩萨——圣母玛丽亚。因为圣母玛丽亚这位圣人通过“显圣”的方法，赋于这眼泉水以神奇的力量和不可思议的疗效。</p><p>&nbsp; &nbsp;这个水泉的水，令许多伤残患者在饮用和浸洗过泉水后不药而愈。法国卢尔德这个泉的奇迹，最初发生于1858年，当地一名乡村女声称圣母玛利亚向她显灵。此后，相继有64名严重垂危的病人在浸过泉水后离奇康复。这些康复例子均都无法在科学观念范围内进行逻辑性的合理解释。曼贾帕医生说：“痊愈的病人往往在很突然、无法估计的情况下就好转过来，完全没有经过该康复时所需要的康复期，而且他们是康复得十分彻底，最少在三四年间完全没问题。”在这些病人康复前，曼贾帕的医学团会为他们做X光及生化检验，证实病人的病情没有可疑的地方。&nbsp;</p><p>&nbsp; &nbsp;有一些病例是令医生无法解释的。在1970年，一名法国男子塞奇·佩林脑部受血凝块严重影响，到卢尔德泉求治。曼贾帕清楚地记得：“他当时全身瘫痪，不能行走，亦差不多完全失明，一名教士为他进行擦身仪式，塞奇就感到一阵暖流通过全身。突然间，塞奇不但再次看到东西，而且还能走动。医学团体对塞奇的例子研究了整整8年，依旧无法解释为何他会突然痊愈。”&nbsp;</p><p>&nbsp; &nbsp;另外一名女子泰奎蒂尔被诊断终身不能行走。她的祖母带她到卢尔德泉浸泉水。第二天，她感到全身一阵冷，到晚上腿部渐渐温暖起来。就这样，她突然便可以两脚活动自如了。&nbsp;</p><p>&nbsp; &nbsp;曼贾帕对12岁女孩奇罗莉的病亦感到困惑。这名女孩因癌症而伤残。当她到卢尔德泉时，医生们都认为她命不久矣。但就在她抵达的当天，奇罗莉居然突然站起身来走动。就这样，她身上的癌症病症离奇地消失了。医生们完全不能相信自己的眼睛。&nbsp;</p><p>圣泉之谜在西方的报刊杂志中都较为广泛地见诸于报导。</p><p><img src="http://image.visp.info/news/20160819/e3f98b81-ac9f-4940-9aca-78266567422b.jpg" _src="http://image.visp.info/news/20160819/e3f98b81-ac9f-4940-9aca-78266567422b.jpg"/></p><p>2、“奇迹之水”的真相——活性氢和ORP</p><p>&nbsp; &nbsp;世界上的奇迹之水都有一个共同的特点，那就是水都呈现弱碱性（PH值在7.2—8.5），较小的水分子团，ORP值比较低，水中含有丰富的Ca+ 、Mg+ 、Na+等矿物质离子，并且水中还含有少量的活性氢元素。&nbsp;</p><p>&nbsp; &nbsp;因此，具有弱碱性、小分子团、活性氢的水被人们称为“奇迹之水”。</p><p>&nbsp; &nbsp; 后来经多方科学研究，对“奇迹之水”进行了化验，得出结论：无论是卢尔德的泉水、托拉克特的井水，还是诺地那的天然水，它们都和普通水没有什么大的差异。但有一点，是这些水的共同之处，就是它们都含有丰富的活性氢！两者的还原能力，它们之间竟有数十倍的巨大差异。 而法国卢尔德的泉水中orp=-150mV，居世界第一（最低），水中含有H-离子，并且钙91mg/L、镁20mg/L、锗7.5mg/L，水的PH值7.9。orp值（氧化还原电位）是水质中一个重要指标，它虽然不能独立反应水质的好坏，但是能够综合其他水质指标来反映水族系统中的生态环境。氧化还原电位越高，氧化性越强，电位越低，氧化性越弱。</p><p><span style="line-height: 1.42857143;">&nbsp; &nbsp; 具有改善疾病功效的水都是含有活性氢并能够消除自由基的天然还原水。至此，长达150年之久的谜团一一奇迹之水的秘密终于被解开。&nbsp;</span></p><p>&nbsp; &nbsp;显而易见，在人们称之为“奇迹之水”的水里面，含有丰富的活性氢。与之相比，普通矿泉水几乎完全不含活性氢。</p><p><img src="http://image.visp.info/news/20160819/07c463ac-b407-4cfe-a567-3879141c9796.jpg" _src="http://image.visp.info/news/20160819/07c463ac-b407-4cfe-a567-3879141c9796.jpg"/></p><p>3、破解奇迹之水的秘密——Enagic电解还原水机</p><p>&nbsp; &nbsp;如果我们能够首先充分理解和认识奇迹水对人体健康的重要意义。那么怎样才能喝到既健康又实惠的奇迹之水呢？Enagic电解还原水机帮你做到。经过Enagic电解处理过的还原水，具备的三个特性，完全符合奇迹水的标准。</p><p>&nbsp; &nbsp;特性一：弱碱性（pH 值8.5-9.5）</p><p><span style="line-height: 1.42857143;">&nbsp; &nbsp;特性二：抗氧化（氧化还原电位orp -800mV至1130mV,且含有大量活性氢）</span></p><p>&nbsp; &nbsp;特性三：水分子小（微细分子团技术，更易吸收）</p><p><img src="http://image.visp.info/news/20160819/a12faf92-1a51-464b-a1e6-c056c78e6c49.jpg" _src="http://image.visp.info/news/20160819/a12faf92-1a51-464b-a1e6-c056c78e6c49.jpg"/></p><p>&nbsp; &nbsp; 那么我们的水机是如何做到的呢？这得归功于Enagic特殊的电解槽，Enagic电解槽由7层钛镀白金电解板组成，功能强大。能稳定生成ORP由+1130mV至-800mV之电解水(因选择之生成水及自来水而不同而异)。自来水经电解后，增加了氢氧离子和阳离子，同时产生氢气。</p><p><img src="http://image.visp.info/news/20160819/f193e2cd-ef1b-4c38-974d-68941cb7fd01.jpg" _src="http://image.visp.info/news/20160819/f193e2cd-ef1b-4c38-974d-68941cb7fd01.jpg"/></p><p><br/></p>', 1, 1, '2016-08-19 18:10:27', 1);
