(183, 40, '【上善健康 · 套装】鹿胎盘活细胞疗法', 'http://image.visp.info/product/20160819/772a8318-5de1-4de3-902c-778c3c8490b9.jpg', '<hr style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"/><h1 style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal"><span style="font-size: 24px;font-family: KaiTi_GB2312">PURTIER胎盘素简介</span></h1><hr style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"/><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;vertical-align: middle">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style="line-height: 2">科学家认定的新鲜胎盘活细胞疗法最重要的一项功能，就是增强人体的免疫系统。在强健的免疫系统中实现：延年益寿，保持细胞、器官及人体健康。</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;vertical-align: middle"><span style="line-height: 2">PURTIER</span><span style="line-height: 2">胎盘素精选鹿胎盘活细胞为原料，搭配另外严选的</span><span style="line-height: 2">9</span><span style="line-height: 2">种珍贵原料进而制作成</span><span style="line-height: 2">PURTIER</span><span style="line-height: 2">胎盘素。</span><span style="line-height: 2">介于鹿与人体具有良好的生物兼容性，</span><span style="line-height: 2">PURTIER</span><span style="line-height: 2">胎盘素采用特选</span><span style="line-height: 2">的新鲜鹿胎盘，从而使PURTIER鹿胎盘素富含的丰富营养成份和活性细胞被人体更好的吸收。</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;vertical-align: middle"><span style="line-height: 2">&nbsp; &nbsp; &nbsp; &nbsp; PURTIER</span><span style="line-height: 2">胎盘素</span><span style="line-height: 2">是纽西兰顶尖医院和实验室经15</span><span style="line-height: 2">年持续不懈的科学研究与开发的心血结晶。</span><span style="line-height: 2">PURTIER</span><span style="line-height: 2">胎盘素</span><span style="line-height: 2">是一种营养补充食品，它不是药物，也不含任何化学物质，堪称是“营养食品中的劳斯莱斯”。PURTIER</span><span style="line-height: 2">胎盘素特选在地球上最后一个未受污染的人间天堂</span><span style="line-height: 2">——纽西兰制造。</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;vertical-align: middle"><span style="line-height: 2"><img src="http://www.visp.top/photos/visptop/attached/image/20151114/20151114164642_98114.jpg" data-ke-src="/photos/visptop/attached/image/20151114/20151114164642_98114.jpg" alt=""/><br/></span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;vertical-align: middle"><span style="line-height: 2"><br/></span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;vertical-align: middle"><span style="line-height: 2"><br/></span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;vertical-align: middle"><br/></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;vertical-align: middle"></p><hr style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px