word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><span style="line-height: normal;font-size: 18px"><strong>&nbsp; &nbsp;<span style="font-size: 12px">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><strong><span style="font-size: 12px">&nbsp;&nbsp;</span></strong><span style="font-size: 12px">&nbsp;</span></strong></span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><span style="line-height: normal"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><span style="font-size: 16px"><strong></strong></span></p><hr style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"/><h1 style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal"><span style="font-family: KaiTi_GB2312">好转反应现象</span></h1><hr style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"/><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><span style="font-size: 16px"><strong></strong></span></p><table cellpadding="3" cellspacing="0" border="1" bordercolor="#000000" style="width: 946px"><tbody><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">疾病症状</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">可能产生的好转反应现象</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">酸性体质者</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会思睡，口干舌燥，频尿及放屁多</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">颈部酸痛、肩膀酸痛、坐骨神经痛、痛风月内风<br/></td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会有几天时间比平常更加酸痛，但是几天后就会慢慢减轻</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">皮肤病</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期肯能会更痒，但数日后即慢慢消失<br/></td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">痔疮</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能大便时会有一时出血或有血丝现象</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">狭心症、心肌梗塞、冠心痛、心律不整</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会有发闷及心悸的现象，但数日后即慢慢消失</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">糖尿病</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能有手脚水肿的现象</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">中风</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">神经系统在开始恢复直觉时，将会有酸痛麻等感觉</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">慢性胃炎</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会胸口发闷、发热、想呕吐及吃不下食物等现象</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">胃溃疡</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能有疼痛或胸闷的感觉</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">慢性肠炎</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会有肠腹泻的现象</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">慢性肝炎</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会皮肤发痒或出疹子有如过敏现象</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">肝硬化</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会大便时有血丝或血块出现</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">慢性支气管炎</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会有口干，想呕吐头晕及不易将痰咳出的现象</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">肺不好</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会有大量吐痰且带乳黄色</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">失眠</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会2-4天更加幸福睡不着的现象</td></tr><tr><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">关节炎、骨刺、尿酸过高</td><td style="font-stretch: normal;font-size: 12px;line-height: 1.5;font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica">使用初期可能会比平时更加酸痛，但是几天后悔慢慢减轻</td></tr></tbody></table><p></p><p><strong style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"></strong></p><p style="word-wrap: break-word;text-indent: 0;vertical-align: middle"><strong style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style="line-height: 2">活细胞及营养素可使身体内的干细胞数量增加，细胞再生能力增强，感觉更精神，更青春有活力。</span></strong></p><p style="word-wrap: break-word;text-indent: 0;vertical-align: middle"><strong style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><span style="line-height: 2">活细胞及营养也可保护及修复损坏的干细胞，加强身体内的的抵抗力及免疫力，疾病自然而然也慢慢改善，身体也因此变得更健康。</span></strong></p><p style="word-wrap: break-word;text-indent: 0;vertical-align: middle"><strong style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><span style="line-height: 2">&nbsp; &nbsp; &nbsp; &nbsp; 由于各人体质不一及症状不同，可能产生的好转反应也不一样，可能不止一次且反应时间长短不一；也有一些人不会有太明确的反应，因此以上内容仅供参考并不能代表所有的人。</span></strong></p><p style="word-wrap: break-word;text-indent: 0;vertical-align: middle"><strong style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><span style="line-height: 2">如有任何好转反应出现，请告知代理员请求协助。</span></strong></p><p style="word-wrap: break-word;text-indent: 0;vertical-align: middle"><strong style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></strong></p><p style="word-wrap: break-word;text-indent: 0;vertical-align: middle"><strong style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></strong></p><hr/><h1><strong style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><span style="font-family: KaiTi_GB2312">成分介</span><span style="font-family: KaiTi_GB2312">绍</span></strong></h1><hr/><p style="word-wrap: break-word"><strong style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><img src="http://www.visp.top/photos/visptop/attached/image/20151126/20151126163221_69912.jpg" data-ke-src="/photos/visptop/attached/image/20151126/20151126163221_69912.jpg" alt=""/></strong></p><p></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><h1 style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal"><span style="color: rgb(255, 255, 255);font-size: 16px;font-family: KaiTi_GB2312;background-color: rgb(229, 51, 51)">您应该即刻签购PURTIER胎盘素的十大理由 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></h1><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第一理由</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;vertical-align: middle"><span style="line-height: 2">PURTIER</span><span style="line-height: 2">胎盘素拥有非凡的品质与价值。它不仅仅使你从感官上觉得年轻，同时还给您几十种必要的健康辅助，您可以从中摄取大量的营养精品，由内而外的调理方式是真正达到回春目的的根本。</span><span style="line-height: 2">PURTIER</span><span style="line-height: 2">胎盘素是有精选鹿胎盘活性细胞与十余种稀有营养配方结合而成，其较高的安全品质和较实惠的产品疗程都得到消费者的广泛认同，更加人性化的干细胞抽取方式使之比人体干细胞抽样治疗更富伦理和道德价值。</span><span style="line-height: 2">PURTIER</span><span style="line-height: 2">胎盘素是得到纽西兰顶级医疗保健开发中心支持，经</span><span style="line-height: 2">15</span><span style="line-height: 2">年的临床医学实验研究而成。在它面市前，始于二十世纪中期六十年代并与其有同等功效的活细胞疗法（注射形式）以三万至二十万美金的高昂价格存在于市场，它只在少数名人和富人的良好口碑下得到推崇。</span><span style="line-height: 2">PURTIER</span><span style="line-height: 2">胎盘素的高科技软胶囊技术的问世，以其低廉的价格将为世人打开方便的幸福之门。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第二理由</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="line-height: 2">PURTIER胎盘素完全无副作用。与其它抗衰老产品不同的是，PURTIER胎盘素不含任何的激素成分来影响您的荷尔蒙分泌，天然的配方来源决定它不含有任何的变异蛋白，完全不用担心出现过敏反应，在国外的临床病例已证实通过胎盘素强化的免疫系统的肌体受病毒侵入的机会几乎为零。它不含有任何的化学物质，而被冠以“营养辅助品中的劳斯莱斯”，同时已获HSA测试成为可与其它处方药物混合使用的营养品。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第三理由</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="line-height: 2">PURTIER胎盘素非常有效。它以其迅速达到理想的功效而闻名，你在连续服用四个星期以内就会感觉到明显的效果。之后的几个月里，由它带来的美颜养生功效不会因身体机能的增强而减弱。如果您像所推荐的疗法一样连续服用6个月，您会永久享受天然的PURTIER为您带来的健康体质和青春亮丽的容颜。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第四理由</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="line-height: 2">PURTIER胎盘素服用方便。您可以选择一天中的任何时间来服用PURTIER胎盘素，饭前饭后均可。把健康的责任推给PURTIER胎盘素，享受简单快乐、无忧无虑的生活。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第五理由</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="line-height: 2">PURTIER胎盘素拥有超凡的品质，出众的价值和公道的价格。注射式细胞疗法的时代已经结束，高达三万美金的费用和只有名人及富豪可享受的权益已经成为历史！PURTIER胎盘素以其同等的功效但少其90%的价格优势成为市场上的新贵——简单的数学计算就能让您了解PURTIER胎盘素和传统注射式疗法的性价比差异，让您信心百倍的服用。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第六理由</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="line-height: 2">PURTIER胎盘素是最有益的保健辅助品。大多数的养颜产品只能带给你少量保健功效，而大多数的保健产品只能带给你少量的养颜功效。然而，PURTIER胎盘素在带给你更多养颜功效的同时，也能带给你更多的保健功效。因为，健康和养颜就如同一枚银币两面，你不能够舍弃任何一面。正是这些因素，让PURTIER胎盘素成为最有益的补品。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第七理由</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="line-height: 2">PURTIER胎盘素是被高认证的保健辅助品。PURTIER胎盘素经过Alpha&nbsp;Laboratories的临床测试。Alpha&nbsp;Laboratories坐落于纽西兰的奥克兰，是南半球其中一间最大、最资深的临床测试研究中心，而其测试结果报告被许多医生所见证和核查。PURTIER胎盘素在纽西兰的独创制造法和包装完全符合严格的GMP、ISO9001、ISO14001、NZFSA、GLP、TQM和SOP等国际标准。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第八理由</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="line-height: 2">PURTIER胎盘素是最为见证的保健辅助品。通过它的介绍说明，来自世界各地的服用者的大量推荐书，见证了PURTIER胎盘素其极度和巨大的功效。所有的见证书来自于原稿，100%非伪造。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第九理由</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="line-height: 2">PURTIER胎盘素是在最值得赞扬的发源地生产和被代理，它生产于纽西兰其中一间最大、最先进、拥有700位专家的制造工厂，目前Alpha&nbsp;Laboratories是少数中的一间活细胞高科技胶囊供应商。然而，我们（日威国际）成为首位东南亚PURTIER胎盘素代理商，我们赢取上万个东南亚PURTIER胎盘素服用者的满意回馈，而且收到来自不同年龄阶段、不同性别的原始推荐书。鉴于PURTIER胎盘素的功效，每一天有更多的人在服用PURTIER胎盘素，更多的人在推广PURTIER胎盘素，让他们的亲朋好友一起享用，见证了我们的信誉。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="color: rgb(229, 51, 51);line-height: 2">第十理由</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal;text-align: justify"><span style="line-height: 2">有了PURTIER胎盘素，您将会得到我们的支持与承诺。我们（Riway&nbsp;International）100%承诺帮助那些想要更健康、更美丽的人们，实现他们的需求。当你有任何询问或需要，我们将一对一的，通过电话或电子邮件的咨询方式，来解决您的疑问。我们随时准备着答复您健康的询问和帮助。总而言之，我们的宗旨就是让健康的人更健康，让美丽的人更美丽。</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><hr style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"/><h1 style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;white-space: normal">为什么选择PURTIER胎盘素</h1><hr style="color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"/><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;white-space: normal"><br/></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">&nbsp; &nbsp; &nbsp; PURTIER胎盘素含特选的鹿蛋白质与胎盆素，与人体具有良好的生物相容性。欧洲爆发的疯牛症与口蹄疫令人忧心，促使我们到不受污染影响的纽西兰寻找这珍贵的保健品。</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;color: rgb(255, 255, 255);font-size: 14px;background-color: rgb(229, 51, 51)"><strong>何谓活细胞疗法?</strong></span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">过去许多名流富豪为了留住青春美丽，不惜千里迢迢飞往瑞士进行胎盘素(羊)注射。这是名流富豪保持精力充沛，年轻貌美和逆转老化的秘诀。其功效虽然显著，但是必须在专业诊所进行，而且收费高昂，至少3万美元起。这类胎盘素的有效使用期通常较短，因为必须采用新鲜提取和杀菌冷藏的胎盘素。</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">随着生产技术的不断进步与发展，如今可采用冻干法以保存胎盘素的活性成份。若配合良好的储存法，这类独特成份的活性可维持3至4年之久。进入人体的独特成份必须保持“活性”，才能促进新陈代谢、滋补强身。</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><strong><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)">PURTIER胎盘素与胎盘素注射相比，何者为佳?</span></strong></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">胎盘素注射必须在医护人员的监督下进行，因为它可能引发敏感、休克和细菌感染等并发症。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">正统的瑞士胎盘素注射乃根据个人情况调配。胎盘素注射的市场需求不减，但确是有钱人才能负担得起。PURTIER胎盘素的功效同样显著，不但人人适合，而且容易获得，再者其价格较低。</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><strong><span style="color: rgb(255, 255, 255);line-height: 2;font-size: 14px;background-color: rgb(229, 51, 51)">普通胎盘素和PURTIER胎盘素有什么分別?</span></strong></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">PURTIER胎盘素萃取自新鲜鹿胎盘，含丰富营养成份和活性因子。这些活性独特成份能有效促进身体健康。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">普通胎盘素通常呈粉末状，经过高温处理加工后，早已不含任何活性成份。因此其功效自然无法与PURTIER胎盘素相提并论。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>为什么我们需要服用PURTIER胎盘素?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">其实老化过程在我们诞生的那一刻即已开始。信不信由你，人类其实可以活到120岁，但是却因为不良的生活方式和饮食习惯、环境污染以及现代生活压力等因素，而导致我们的身体未老先衰，各种疾病丛生。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">各种不良的生活习惯导致体内产生大量自由基。自由基会破坏人体细胞和组织，也是形成老化的元凶。PURTIER胎盘素能有效促进新陈代谢、调整体质、青春永驻。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>PURTIER胎盘素如何发挥效用?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">PURTIER胎盘素所含的活细胞能促进现有组织的生长与功能，让活细胞激活体内“休眠中”的细胞，以及制造新的神经节和缔结组织。它是无毒性的健康营养补充品，能改善身体整体机能。</span></p><p style="word-wrap: break-word;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>胎盘素所含的珍贵营养成份如何被人体吸收?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">PURTIER胎盘素采用顶尖技术研制而成，因此其珍贵营养成份能轻易被人体吸收。在生产制作过程中采用独特的乳化分解技术后，即使是大颗粒的分子也能被人体良好吸收。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><strong><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)">如何获取鹿胎盘?</span></strong></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">PURTIER胎盘素独特成份萃取自母鹿分娩后的新鲜鹿胎盘，因此无需宰杀鹿只，接着采用先进的冻干技术良好保存其活性因子。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>哪些人需要它?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">想要逆转时光、维持健康、青春永驻者，以及身体已经开始退化者均可选择服用它。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>什么时候开始服用为宜?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">人体在25岁以后逐渐开始老化，随着年龄增长容易感觉疲劳。因此，建议大家在25岁后开始服用，无论身体健康与否或有任何健康问题，因为它对身体有益，使身体维持健康年轻。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>如何服用?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">建议在第一个月每天服用4颗，任何时间服用皆可。接着在随后的月份，每天服用2颗。其服用量因个人需求而异。您可依据个人情况酌量增加或减少服用量。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>可否与中药和西药同时服用?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">PURTIER胎盘素不是药物，而且不含任何化学物质。它和其他的营养补充品一样，不会和中药和西药产生任何冲突。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>服用后体内是否会产生燥热现象?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">一般上不会，但是建议多喝水，喝水量宜比平时多。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>请问我需要服用多久?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">建议保养周期为6个月。多年来已逐渐退化的生理机能需要时间慢慢滋补调节，加上个人体质不同，因此，必须持续服用才能有效促进身体健康。持续服用6个月是最理想的保养周期，以便让生理机能拥有充足的时间调节。虽然如此，服用多久可见其效其实因人而异。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>可否服用两个月就停止使用?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">这是个人选择，但是建议至少服用6个月以取得更显著的效果。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>完成六个月保养周期后是否还要继续服用?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">若您认同它的效益，不妨继续服用。更何况长期服用完全不会造成任何副作用。即使停止服用，身体也不会发生任何依赖性问题。持续服用PURTIER胎盘素，将能使身体通过营养补给过程，继续保持青春活力。</span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2;font-size: 14px;color: rgb(255, 255, 255);background-color: rgb(229, 51, 51)"><strong>我是否需要继续服用其他营养补充品?</strong></span></p><p style="word-wrap: break-word;margin-left: 0;color: rgb(0, 0, 0);font-family: &#39;sans serif&#39;, tahoma, verdana, helvetica;font-size: 12px;line-height: 18px;text-indent: 0;white-space: normal"><span style="line-height: 2">PURTIER胎盘素是一种营养补充食品，能有效调节生理机能，使身体保持青春活力。PURTIER胎盘素采用鹿胎盘独特成份和其他9种珍贵成份配制而成，能帮助调节生理机能、增强体力、青春永驻，持续服用PURTIER胎盘素就已足够为人体提供长期所需要的营养。</span></p><p><span style="line-height: 2"><br/></span></p><p><br/></p>', 0, 20, 10000, '21000.00', '20000.00', 2, 1, '2016-08-23 09:55:34', '2016-08-19 17:45:08');
