(2, 'subscribe_scan_notice', '扫码关注通知', '欢迎【{nickname}】关注上善网络公众号，如果没有购买成为会员，请购买成为会员，创建属于您的上善网络家族!', NULL, 1, '0000-00-00 00:00:00'),
(3, 'purchase_order_notice', '购买下单通知', '您的一级代言人【{nickname}】在{datetime}下单，订单号为：{orderNo}；订单金额为：{money}元；您将获得的提成为：{award}元。', NULL, 1, '2016-08-18 16:02:05'),
(4, 'cancle_order_notice', '取消订单通知', '您的一级代言人【{nickname}】在{datetime}取消定单，订单号为：{orderNo}。', NULL, 1, '2016-08-18 16:04:16'),
(5, 'confirm_order_notice', '确认订单通知', '您的一级代言人【{nickname}】在{datetime}确认收货，订单号为：{orderNo}；订单金额为：{money}元；您将获得的提成为：{award}元。', NULL, 1, '2016-08-18 16:05:10'),
(6, 'deliver_goods_notice', '发货通知', '您购买的商品{title}已经发货，订单号为{orderNo}。', NULL, 1, '2016-08-18 16:08:05'),
(7, 'express_notice', '快递发送通知', '您购买的商品{title}快递已发件，快递公司为: {company},快递单号:{number}', NULL, 1, '2016-08-18 16:09:19'),
(8, 'become_promoter_notice', '成为推广人通知', '【{nickname}】通过二维码关注了本公众号，成为了您的一级上善网络家族成员!', NULL, 1, '2016-08-18 16:28:44');
